function Cadastrar() {
    return(
        <>
        <h1>Cadastrar Minha Meta</h1>
        <hr />

        <form>
            <label>Nome </label>
            <input type="text" name="name" id="name" placeholder="Nome da Meta" /><br /><br />
        </form>
        
        </>
    );
}

export default Cadastrar;
